                <input type="number"
                    className="inpupt"
                    value={n1}
                    onChange={e => setN1(parseInt(e.targer.value))} />
                <input type="number"
                    className="inpupt"
                    value={n2}
                    onChange={e => setN2(parseInt(e.targer.value))} />
                <input type="number"
                    className="inpupt"
                    value={n3}
                    onChange={e => setN3(parseInt(e.targer.value))} />
            </div>
        </div>
    )
}

export default UseMemo
